import React from 'react'
// react-boostrap
import Tabs from 'react-bootstrap/Tabs'
import Tab from "react-bootstrap/Tab"
import Jumbotron from 'react-bootstrap/Jumbotron'
import Container from 'react-bootstrap/Container'
// redux
import { connect } from 'react-redux'
// styling 
import 'bootstrap/dist/css/bootstrap.min.css';
//import 'custom.scss'
// components
import Home from "./Home"
import Plans from "./Plans"
import ExistingWellPlans from './ExistingWellPlans'


const App = ({selectedWell}) => {
  return (
    <React.Fragment>
      <Jumbotron fluid className="bg-dark text-white">
        <Container>
          <h1>LandShark App (Employee Portal)</h1>
        </Container>
      </Jumbotron>
      <Tabs>
        <Tab eventKey="Home" title="Home">
          <Container>
            <Home/>
          </Container>
        </Tab>
        <Tab eventKey="Plans" title="Plans" disabled={(selectedWell.status === 'received' ? true : false) || !selectedWell.status ? true : false}>
          <Container>
            <Plans/>
          </Container>
        </Tab>
        <Tab eventKey="ExistingWellPlans" title="ExistingWellPlans" disabled={selectedWell.status === "received" ? false : true}>
          <Container>
            <ExistingWellPlans/>
          </Container>
        </Tab>

      </Tabs>
    </React.Fragment>
  );
}

const mapStateToProps = ({selectedWell}) => {
  return {selectedWell}
}

export default connect(mapStateToProps)(App);
